// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Evidence.sol";
import "./Issued.sol";

contract Case is Evidence, Issued {

    //Case ID counter
    uint public caseId;

    //Case info struct
    struct CaseInfo {
        uint caseNum;
        string caseName;
        string caseDesc;
        address[] caseInvestigators;
        address creator;
        string creationTime;
        mapping (uint => Evidence.EvidenceInfo[]) evidenceList;
        bool closed; //default false
    }

